import React, {useState, useContext} from 'react';

import {MenuSettingsWrapper, MenuSettingsItem} from '../../components/Profile/styledProfileHeader'
import {Text} from "../StyledComponents/Text";
import {Input, TextArea} from "../controls/Input/Input";
import Select from "../controls/Select/Select";
import DatePicker from "../controls/DateTimePickers/Datepicker";
import {Wrapper} from "../StyledComponents/Wrapper";
import {listCountries, listLanguages} from "../../utils/countriesLanguages";
import {Divider} from "../StyledComponents/Divider";
import {Button} from "../controls/Button/Button";
import RegAvatar from '../../components/controls/Upload/RegAvatar'


const Photos = ({user}) => {
    return (
        <>
            <Text bold fz={18} mb={10} >Be ready to book</Text>
            <Text fz={14} mb={30} grey6 >You’ll need to provide identification before you book, so get a head start by doing it now.</Text>
            <Button blue inline >Provide ID</Button>
            <Text bold fz={18} mb={30} mt={50} >Your verified info</Text>
            <Text bold fz={14} mb={10} >Email address</Text>
            <Text fz={14} mb={30} grey6 >
                You have confirmed your email: <span className={'text-bold'}>{user.email}.</span> A confirmed email is important to allow us to securely communicate with you.

            </Text>

            {/*<Text bold fz={14} mb={10} >Phone number</Text>*/}
            {/*<Text fz={14} mb={30} grey6 >*/}
            {/*    Your number is only shared with another Programmerbooking member once you have a confirmed booking.*/}
            {/*</Text>*/}

            {/*<Text bold fz={14} mb={10} >Google</Text>*/}
            {/*<Text fz={14} mb={30} grey6 >*/}
            {/*    Connect your Programmerbooking account to your Google account for simplicity and ease.*/}
            {/*</Text>*/}

            {user.typeRegistration == 'facebook' &&
                <>
                    <Text bold fz={18} mb={20} mt={50} >Your social accounts</Text>
                    <Text bold fz={14} mb={10} >Facebook</Text>
                </>
            }

            {/*<Text fz={14} mb={20} grey6 >*/}
            {/*    Sign in with Facebook and discover your trusted connections to hosts and guests all over the world.*/}
            {/*</Text>*/}
            {/*<Button transparent >Connect</Button>*/}

        </>

    );
};

export default Photos;
